for (let number = 1; number <= 20; number++) {
    items.push(
      <BPagination.Item 
        onClick={() => setActivePage(number++)} 
        key={number} 
        active={number === activPage}
      >
        {number}
      </BPagination.Item>,
    );
  }
  
  
